const Header = () => {

    return (
        <div className="bg-pink-200 h-52  py-6 px-24 flex">
            <div>
                <img src={iconImage} className="rounded-full h-fu" />
            </div>
            <div className='bg-blue-400 w-full h-full ml-8'>
                <h1>Dianne Mae Fabiano</h1>
            </div>
        </div>
    );
};

export default Header;
